INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ペコリーヌとの出会い", 40, 91002, "青空の下で謁見", "フリーマーケット会場", 1, 0, 8, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2, 10118, 5118061, 7, 20063115, 2834);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("マホとの出会い", 40, 91002, "未来の騎空団\nマスコット？", "フリーマーケット会場", 1, 0, 8, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2, 10118, 5118062, 7, 20063115, 2835);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("アキノとの出会い", 40, 91002, "お嬢さまからの\n緊急依頼", "ランドソル市街地", 1, 0, 8, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2, 10118, 5118063, 7, 20063115, 2837);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ジュンとの出会い", 40, 91002, "黄金色の悩みごと", "フリーマーケット会場", 1, 0, 8, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 2, 10118, 5118064, 18, 20063115, 4108402);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("カオリとの出会い", 40, 91002, "白熱！　格闘大会！", "フリーマーケット会場", 1, 0, 8, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 2, 10118, 5118065, 18, 20063115, 4107402);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ニノンとの出会い", 40, 91002, "祭り太鼓はオーエドの華", "オーエド町", 1, 1, 8, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 2, 10118, 5118066, 16, 20063115, 9000227);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("スズナとの出会い", 40, 91002, "人気者は遅れて\nやってくる", "フリーマーケット会場", 1, 0, 8, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 3, 10118, 5118067, 19, 20063115, 2101181);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ナナカとの出会い", 40, 91002, "巫女・ミーツ・魔法少女", "ランドソル市街地", 1, 0, 8, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 3, 10118, 5118068, 18, 20063115, 4109402);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("キャル＆コッコロとの出会い", 40, 91002, "ネズ耳は二度なくなる", "フリーマーケット会場", 1, 0, 8, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 3, 10118, 5118069, 18, 20063115, 4305402);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ユカリとの出会い", 40, 91002, "この出会いにカンパイ！", "ランドソル市街地", 1, 0, 8, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 3, 10118, 5118070, 18, 20063115, 4101402);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("アオイとの出会い", 40, 91002, "陰陽アンサンブル", "ランドソル市街地", 1, 0, 8, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 3, 10118, 5118071, 18, 20063115, 4106402);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("シノブとの出会い", 40, 91002, "運試し十番勝負！", "フリーマーケット会場", 1, 1, 8, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 3, 10118, 5118072, 7, 20063115, 2836);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("オープニング", 0, 0, "彼女たちの新たな日常", 0, 0, 0, 0, 0, 1, 10118, 5118600, 0, 20063115, 0);
